import React from 'react'
import { NavLink } from 'react-router-dom'


function NavBar() {
  return (
    <div className=''>
      <NavLink to='/'>Home</NavLink>
        <NavLink to='/products'>Products</NavLink>
        <NavLink to='/cart'>Cart</NavLink>
    </div>
  )
}

export default NavBar
